import React from 'react';
import './CSS/prompt.css'

function TopButton() {
    return (
        <div className='topButton' onClick={() => { window.scrollTo(0, 0) }}>
        </div>);
}

class Jump extends React.Component {
    constructor(props) {
        super(props);
        this.name = ['基本信息', '学术能力', '社交能力', '普通能力', '结果'].map(
            (v, i) => <div className='jumpItems' onClick={(e) => { fun(i) }}>{v}</div>);
            this.num = props.num;
    }

    componentWillMount() {

    }

    componentWillUnmount() {

    }
    render() {
        if (window.innerWidth <= 1050) return <div></div>;
        let fun = props.change;
        
        return (
            (<div className='jump'>
                {this.name}
                <div className='jumpPoint'>
                    剩余总点数
            <div className='jumpPointNum'>{props.num}</div>
                </div>
            </div>)
        );
    }
}

export default prompt;

class prompt extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <div></div>
        );
    }
}

export {
    prompt,
    TopButton,
    Jump
};
